use super::{query::parse_asn1, bignum::fns::constrained_ops, query::fetch_dg1, verify::verify_certificate};
use std::{field, hash::poseidon::PoseidonHasher};

pub fn register_identity(
    tbs: [u8; 1200],
    pk: [Field; 18],
    reduction: [Field; 18],
    signature: [Field; 18],
    len: u32,
    icao_root: Field,
    inclusion_brances: [Field; 80],
    sk_identity: Field,
) -> (Field, Field, Field, Field) {
    // 1. Verify certificate
    let hashed = verify_certificate(tbs, pk, reduction, signature, len);

    // 2. Extract pk_hash
    let leaf = extract_pk_hash(pk);
    let key = leaf;
    let is_verfied = super::smt::smt_verifier::<80>(icao_root, leaf, key, inclusion_brances);
    assert(is_verfied == 1, "Merkle tree verification failure");

    // 3. Get dg1Commitment
    // Get imitation of dg1: there is no dg1, but we can get str with name surname country, etc;

    let dg1_commitment = extract_dg1_commitment(tbs, sk_identity);
    let sk_hash = extract_sk_identity_hash(sk_identity);

    let pasport_hash = extract_passport_hash(hashed);
    // (dg15_pk_hash, passport_hash, dg1_commitment, sk_hash)
    (0, pasport_hash, dg1_commitment, sk_hash)
}

fn extract_pk_hash(pubkey: [Field; 18]) -> Field {
    let mut pk_bits: [u1; 960] = [0; 960];
    for i in 0..8 {
        let bits: [u1; 120] = pubkey[i].to_le_bits();
        for j in 0..120 {
            pk_bits[i * 120 + j] = bits[j];
        }
    }

    let mut chunks: [Field; 15] = [0; 15];
    for i in 0..15 {
        let mut current = 1;
        for j in 0..64 {
            chunks[i] += (pk_bits[i * 64 + j] as Field) * current;
            current *= 2;
        }
    }
    let mut hasher = PoseidonHasher::default();

    for i in 0..5 {
        hasher.write(
            chunks[i * 3] * 340282366920938463463374607431768211456
                + chunks[i * 3 + 1] * 18446744073709551616
                + chunks[i * 3 + 2],
        );
    }

    hasher.finish()
}

fn extract_dg1_commitment(tbs: [u8; 1200], sk_identity: Field) -> Field {
    let mut poseidon_hasher = PoseidonHasher::default();

    let mut short_tbs = [0; 320];
    for i in 0..320 {
        short_tbs[i] = tbs[i];
    }
    let dg1 = fetch_dg1(short_tbs);
    let mut dg1_chunks = [0; 4];
    let mut current = 1;

    for i in 0..27 {
        for ii in 0..4 {
            dg1_chunks[ii] += current * dg1[ii * 27 + i] as Field;
        }
        current *= 256;
    }
    for i in 0..4 {
        poseidon_hasher.write(dg1_chunks[i]);
    }

    let mut poseidon_hasher_2 = PoseidonHasher::default();
    poseidon_hasher_2.write(sk_identity);
    poseidon_hasher.write(poseidon_hasher_2.finish());
    poseidon_hasher.finish()
}

pub fn extract_sk_identity_hash<>(sk_identity: Field) -> Field {
    let mut hasher = PoseidonHasher::default();
    let point = super::jubjub::priv_to_pub(sk_identity);
    hasher.write(point.0);
    hasher.write(point.1);

    hasher.finish()
}

fn extract_passport_hash(sa_hash: [u8; 32]) -> Field {
    let mut poseidon_hasher = PoseidonHasher::default();
    let mut sa_hash_bits: [u1; 252] = [0; 252];

    for i in 0..32 {
        let tmp_bits = u8_to_8_u1(sa_hash[i]);
        if (i != 31) {
            for j in 0..8 {
                sa_hash_bits[i * 8 + j] = tmp_bits[j];
            }
        } else {
            for j in 0..4 {
                // 248 - 251 bits
                sa_hash_bits[i * 8 + j] = tmp_bits[j];
            }
        }
    }

    let mut current = 1;
    let mut preimage = 0;
    for i in 0..252 {
        preimage += (sa_hash_bits[i] as Field) * current;
        current *= 2;
    }

    poseidon_hasher.write(preimage);
    poseidon_hasher.finish()
}

fn u8_to_8_u1(x: u8) -> [u1; 8] {
    let out = __u8_to_8_u1(x);
    assert(
        (out[0] as u8) * 128
            + (out[1] as u8) * 64
            + (out[2] as u8) * 32
            + (out[3] as u8) * 16
            + (out[4] as u8) * 8
            + (out[5] as u8) * 4
            + (out[6] as u8) * 2
            + (out[7] as u8)
            == x,
        "byte to bits conversion",
    );
    out
}

unconstrained fn __u8_to_8_u1(x: u8) -> [u1; 8] {
    let mut x_clone = x;
    let mut out: [u1; 8] = [0; 8];
    for i in 0..8 {
        out[7 - i] = (x_clone % 2) as u1;
        x_clone = x_clone / 2;
    }
    out
}

